  [],\n\t\"revision_timestamp\": \"2015-06-19T16:42:22.475143\",\n\t\"name\": \"digital-flood-insurance-rate-map-database-ralls-county-usa\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Digital Flood Insurance Rate Map (DFIRM)
  Database depicts flood risk information and supporting data used to develop the
  risk data. The primary risk classifications used are the 1-percent-annual-chance
  flood event, the 0.2-percent-annual- chance flood event, and areas of minimal flood
  risk. The DFIRM Database is derived from Flood Insurance Studies (FISs), previously
  published Flood Insurance Rate Maps (FIRMs), flood hazard analyses performed in
  support of the FISs and FIRMs, and new mapping data, where available. The FISs and
  FIRMs are published by the Federal Emergency Management Agency (FEMA). In addition
  to the preceding, required text, the Abstract should also describe the projection
  and coordinate system as well as a general statement about horizontal accuracy.\",\n\t\"license_title\":
